import Layout from '../components/MyLayout.js'
import Link from 'next/Link'

const PostLink = props => (
    <li>
        <Link href = {`/post?title = ${props.title}`}>
            <a>{props.title}</a>
        </Link>
    </li>
)

export default function Blog() {
    return (
        <Layout>
            <h1>My Blog</h1>
            <p>This is the about page</p>
        </Layout>
    )
}
